import React, { useState } from "react";
import { Container, Row, Col, ProgressBar, Modal, Button } from "react-bootstrap";

const Skills = () => {
  return (
    <>
      <Container>
        <Row className="hobbies mt-5  m-2">
          <Col xs={12} lg={6} className="hobby-item">
            <h2>Desarrollo Web</h2>
            <div className="hobby-icon"><i className="fa-solid fa-film"></i></div>
        <div className="hobby-text"> <ButtonModal
              content={[
                <ProgressBarData tittle="HTML" per={80} color="info" />,
                <ProgressBarData tittle="CSS" per={80} color="info" />,
                <ProgressBarData tittle="SCSS" per={80} color="info" />,
                <ProgressBarData tittle="JAVASCRIPT" per={80} color="info" />,
                <ProgressBarData tittle="PHP" per={80} color="info" />
              ]}
            /></div>
           
          </Col>
          <Col xs={12} lg={6}>
            <h2>Metodologías de trabajo</h2>
            <ButtonModal
              content={[
                <ProgressBarData tittle="SCRUM" per={80} color="info" />,
                <ProgressBarData tittle="RUP" per={80} color="info" />
              ]}
            />
          </Col>
        </Row>
        <Row className="mt-5 neon-border-r m-2">
          <Col xs={12} lg={6}>
            <h2>Lenguajes de programación</h2>
            <ButtonModal
              content={[
                <ProgressBarData tittle="JAVA" per={78} color="danger" />,
                <ProgressBarData tittle="PYTHON" per={68} color="danger" />,
                <ProgressBarData tittle="C#" per={68} color="danger" />,
                <ProgressBarData tittle="C++" per={68} color="danger" />
              ]}
            />
          </Col>
          <Col xs={12} lg={6}>
            <h2>Gestor de base de datos</h2>
            <ButtonModal
              content={[
                <ProgressBarData tittle="MySQL" per={78} color="warning" />,
                <ProgressBarData tittle="ORACLE" per={68} color="warning" />,
                <ProgressBarData tittle="MS SQL Server" per={68} color="warning" />
              ]}
            />
          </Col>
        </Row>
        <Row className="mt-5 neon-border-g m-2">
          <Col xs={12} lg={6}>
            <h2>Frameworks</h2>
            <ButtonModal
              content={[
                <ProgressBarData tittle="REACT" per={78} color="success" />,
                <ProgressBarData tittle="LARAVEL" per={68} color="success" />,
                <ProgressBarData tittle="FLUTTER" per={68} color="success" />,
                <ProgressBarData tittle="UNITY 2D" per={68} color="success" />
              ]}
            />
          </Col>
          <Col xs={12} lg={6}>
            <h2>IDEs</h2>
            <ButtonModal
              content={[
                <ProgressBarData tittle="APACHE NETBEANS" per={78} color="success" />,
                <ProgressBarData tittle="ANDROID STUDIO" per={68} color="success" />,
                <ProgressBarData tittle="VISUAL STUDIO .NET" per={68} color="success" />
              ]}
            />
          </Col>
        </Row>
      </Container>
    </>
  );
};

const ProgressBarData = ({ tittle, per, color }) => {
  return (
    <div className="p-2">
      <div className="text-start">{tittle}:</div>
      <div className="text-end">
        <i className="float-right">{per}%</i>
      </div>
      <ProgressBar now={per} label={`${per}%`} visuallyHidden variant={color} />
    </div>
  );
};

const ButtonModal = ({ content }) => {
  const [showModal, setShowModal] = useState(false);

  const handleCloseModal = () => {
    setShowModal(false);
  };

  const handleOpenModal = () => {
    setShowModal(true);
  };

  return (
    <>
      <Button
        size="sm"
        variant="outline-primary"
        onClick={handleOpenModal}
      >
        Abrir Modal
      </Button>

      <Modal
        show={showModal}
        onHide={handleCloseModal}
        backdrop="static"
        dialogClassName="custom-modal modal-90w"
        aria-labelledby="example-modal-sizes-title-lg"
        centered
        size="xl"
      >
        <Modal.Header>
          <Modal.Title>Contenido</Modal.Title>
          <button className="custom-close-button" onClick={handleCloseModal}>
            &times;
          </button>
        </Modal.Header>

        <Modal.Body>
          {content}
        </Modal.Body>
      </Modal>
    </>
  );
};

export default Skills;
